function sepratetDateTime(dateStr) {
  var date = new Date(dateStr);

  // Extract date parts
  var year = date.getFullYear();
  var month = String(date.getMonth() + 1).padStart(2, '0');
  var day = String(date.getDate()).padStart(2, '0');
  var hours = String(date.getHours()).padStart(2, '0');
  var minutes = String(date.getMinutes()).padStart(2, '0');
  var seconds = String(date.getSeconds()).padStart(2, '0');

  // fractional seconds (7 digits)
  var ms = String(date.getMilliseconds()).padStart(3, '0') + '0000';
  var formattedDate = "".concat(year, "-").concat(month, "-").concat(day, " ").concat(hours, ":").concat(minutes, ":").concat(seconds, ".").concat(ms);

  // ----- TIME FORMAT -----
  var hour12 = date.getHours() % 12;
  hour12 = hour12 === 0 ? 12 : hour12;
  var formattedTime = "".concat(String(hour12).padStart(2, '0'), ":").concat(minutes) + (date.getHours() >= 12 ? 'PM' : 'AM');
  return {
    date: formattedDate,
    time: formattedTime
  };
}

